import React from "react";
import "./AboutPage.scss";

export const AboutPage = () => {
  return (
    <div className="AboutPage">
      <h1 className="aboutHeading">About: </h1>
      <p> Children Songs of the world let you search for kid songs from different countries </p>
      <a href="https://github.com/charitety">
        Check the creator's Github
      </a>
    </div>
  );
};
